import MediumIcon from "./Icons/Medium";
import SearchIcon from "./Icons/Search";

export default function Header() {
  return (
    <div className=" px-[24px] border-b border-[#F2F2F2] flex items-center justify-between h-[57px]">
      <div className="flex gap-x-[16px] items-center">
        <MediumIcon />
        <div className=" bg-[#F9F9F9] w-[240px] rounded-[20px] flex items-center">
          <div className=" mx-3">
            <SearchIcon />
          </div>
          <input
            className=" bg-transparent py-[10px] pr-[20px] text-sm"
            placeholder="Search"
          />
        </div>
      </div>
      <div></div>
    </div>
  );
}
